import React from 'react';
import Container from '@material-ui/core/Container';
import DatePickers from '../Components/DateTimePicker';
import ContainedButtons from '../Components/Button1';
import BasicButtonGroup from '../Components/ButtonGroup1';
import Checkboxes from '../Components/Checkbox1';
import FloatingActionButtons from '../Components/FloatingActionButton';
import MaterialUIPickers from '../Components/Datepicker';
import SimpleBottomNavigation from '../Components/BottomNavigation';
import SimpleBreadcrumbs from '../Components/Breadcrumbs';
import RadioButtonsGroup from '../Components/RadioGroup';
import SimpleAccordion from '../Components/Accordion';

export default function Home() {
  return (
    <React.Fragment>
        <Container fixed>
           
            <ContainedButtons/>
            <BasicButtonGroup/>
            <Checkboxes/>
            <FloatingActionButtons/>
            <MaterialUIPickers/>
            <SimpleBottomNavigation/>
            <SimpleBreadcrumbs/>
            <RadioButtonsGroup/>
            <SimpleAccordion/>
        </Container>
    </React.Fragment>
  );
}
